import React from 'react';
import ReactDOM from 'react-dom';
import {add , sub , mult , div } from './Cal';

ReactDOM.render(
    <>
        <ol>
            <li>{add(10,3)}</li>
            <li>{sub(10,3)}</li>
            <li>{mult(10,3)}</li>
            <li>{div(10,3)}</li>
        </ol>
    </>
    , document.getElementById('root')
);
